import React from 'react';
import Layout from '../../Components/layout';
import {
    Card,
    H2,
    Divider,
    UL,
    Button,
} from "@blueprintjs/core";

function TodoPage(props) {
    return (
        <Layout>
            <Card>
                <H2>TODO</H2>

                <Divider />

                <UL className="todo-list">
                    <li className="todo-item">
                        <Button
                            small
                            icon="remove"
                            intent="danger"
                            className="todo-item-action"
                        />
                    </li>
                </UL>
            </Card>
        </Layout>
    );
}

export default TodoPage;
